import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Page1 from './pages/page1.js';
import Page2 from './pages/page2.js';


function App() {
  return (
    <Router>
      <switch>
        <Route path="/a" Component={Page1} />
      </switch>
    </Router>
  );
}

export default App;
